    localStorage.setItem("myString", JSON.stringify(myObject));
    let yer = JSON.parse(localStorage.getItem("myString"));
    console.log(yer.prenom);
  };
  document.body.onclick = () => {
    localStorage.clear();
  };

  console.log(stringOne.trimStart());
  return (
    <div className="container">
      <button className="btn btn-success px-5">MyModal</button>
    </div>
  );
};

